class Solution:
    def __init__( self ):
        self.answer = 0
    
    def positionAllIsland( self, girdInput ):
        allPosition = []
        islandPosition = []
        finalIslandPosition = []
        
        for xIndex in range( len( girdInput ) ):
            for yIndex in range( len( girdInput[ xIndex ] ) ):
                allPosition.append( ( xIndex, yIndex ) )
                if( girdInput[ xIndex ][ yIndex ] == 1 ):
                    islandPosition.append( ( xIndex, yIndex ) )
        
        finalIslandPosition = allPosition[ len( allPosition ) - 1 ]
        
        return islandPosition, allPosition, finalIslandPosition
    
    def countBorderLine( self, areaIsland, finalIsland ):
        positionArray = [ ( 0, -1 ), ( 0, 1 ), ( -1, 0 ), ( 1, 0 ) ]    # Top, Bottom, Left, Right
        countBorderLine = 0
        nearArea = 0
        
        for searchBorderLine in areaIsland:
            xArea, yArea = searchBorderLine
            # print( "Current postion ->", f" x:{ xArea }, y:{ yArea } " )
            
            for xNearArea, yNearArea in positionArray:
                areaForCheck = ( xArea + xNearArea, yArea + yNearArea )
                # print( "Area for check ->", f" x:{ areaForCheck[ 0 ] }, y:{ areaForCheck[ 1 ] } " )
                
                if( areaForCheck in areaIsland ):
                    nearArea += 1
                
            # print( nearArea )
            
            if( nearArea == 3 ):
                countBorderLine += 1
            elif( nearArea == 2 ):
                countBorderLine += 2
            elif( nearArea == 1 ):
                countBorderLine += 3
            elif( nearArea == 0 ):
                countBorderLine += 4
            nearArea = 0
            
        # print( "Final count border line:", countBorderLine )
                
        return countBorderLine
    
    def islandPerimeter( self, grid ):
        areaIsland, allIsland, finalIsland = self.positionAllIsland( grid )
        # print( "Area of island -->", areaIsland )
        # print( "All area of island -->", allIsland )
        # print( "final area of island -->", finalIsland )
        
        borderLine = self.countBorderLine( areaIsland, finalIsland )
        
        self.answer = borderLine
        
        return self.answer
    
